import React from 'react';
import Card from './Card';
import styled from "styled-components" 

const CardListContent = styled.div `
    display: grid;

`;

const CardList = () => {
    return (
        <CardListContent>
            <Card></Card>
            <Card></Card>
            <Card></Card>
            <Card></Card>
            <Card></Card>
            <Card></Card>
        </CardListContent>
    );
};

export default CardList;
